def makeEventFormat(event):
    event_type = event['EventType']
    class_name = event['Action']['ClassName']
    return android_event_type_value[event_type]+android_event_class_type[class_name]

def makeUpFormat(slice_event):
    slice_format = []
    for slice in slice_event:
        event_format = []
        for event in slice:
            event_type = event['EventType']
            class_name = event['Action']['ClassName']
            event_format.append([android_event_type_value[event_type]+android_event_class_type[class_name]])
        slice_format .append(event_format)

    return slice_format

def summaryByRepeat(slice_format):
    slice_repeat_format = []
    for slice in slice_format:
        repeat_format = []
        for i in range(len(slice)):
            repeat_format_little = []
            repeat_format_little+=(slice[i])
            if i + 1 == len(slice):
                repeat_format.append(repeat_format_little)
                break
            while slice[i] == slice[i+1]:
                repeat_format_little+=(slice[i+1])
                i+=1
                if i+1 == len(slice):
                    break
            if len(repeat_format)==0:
                repeat_format.append(repeat_format_little)
            if repeat_format_little[-1] != repeat_format[-1][-1]:
                repeat_format.append(repeat_format_little)
            if i + 1 == len(slice):
                break
        slice_repeat_format.append(repeat_format)


    return slice_repeat_format

def theCountOfRepeatEvent(slice_repeat_format):
    count = 0
    for slice in slice_repeat_format:
        for s_repeat in slice:
            if len(s_repeat)>3:
                count+=1
    return count

