def findRepeatSequence(slice_event):
    slice_event_str = []

    for slice in slice_event:
        e_words = ''
        for e in slice:
            e_words += e['PackageName'] + ' ' + e['EventType'] + ' ' + \
                       e['Action']['ClassName']
            try:
                text = e['Action']['Text']
                e_words += text
            except IndexError:
                e_words += ' '
                pass
        slice_event_str.append(e_words)
    repeat_list = {}
    for i in range(len(slice_event_str)):
        if slice_event_str.index(slice_event_str[i]) not in repeat_list:
            repeat_list[slice_event_str.index(slice_event_str[i])] = []
        if i != slice_event_str.index(slice_event_str[i]):
            repeat_list[slice_event_str.index(slice_event_str[i])].append(i)
    return repeat_list

def returnNoneRepeatSequence(slice_event,repeat_list):
    pop_list = []
    for r in repeat_list:
        if len(r) > 1:
            for d in r[1:]:
                pop_list.append(d)
    for d in sorted(pop_list,reverse=True):
        slice_event.pop(d)
    return slice_event
